import React from "react";

const Harrypotterfront1 = () => {
  return (
    <div>
      <img
        src="./harrypotter.jpg"
        alt="harrypotter"
        style={{
          width: "400px",
          height: "400px",
          borderRadius: "5%",
          boxShadow: "10px 10px 10px #aaaaaa",
        }}
      ></img>
    </div>
  );
};

export default Harrypotterfront1;
